import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const AddDestination = () => {
  const [destination, setDestination] = useState({
    destinationName: "",
    district: "",
    province: "",
    category: "",
    keyHighlights: "",
  });

  const navigate = useNavigate();

  const handleChange = (e) => {
    setDestination({ ...destination, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post("http://localhost:5000/api/destinations", {
        ...destination,
        keyHighlights: destination.keyHighlights.split(","),
      });
      navigate("/");
    } catch (error) {
      console.error("Error adding destination:", error);
    }
  };

  return (
    <div
      className="d-flex align-items-center justify-content-center vh-200 "
      style={{ height: "350px", marginTop: "250px" }}
    >
      <form
        className="p-4 border rounded shadow bg-light"
        style={{ marginLeft: "-1250px", width: "900px" }}
        onSubmit={handleSubmit}
      >
        <h3>Add Destinations</h3>
        <div className="row">
          <div className="form-group col-md-6">
            <label htmlFor="destinationName">Destination Name</label>
            <input
              type="text"
              className="form-control"
              name="destinationName"
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group col-md-6">
            <label htmlFor="district">District</label>
            <input
              type="text"
              className="form-control"
              name="district"
              onChange={handleChange}
              required
            />
          </div>
        </div>

        <div className="row">
          <div className="form-group col-md-6 mt-3">
            <label htmlFor="province">Province</label>
            <input
              type="text"
              className="form-control"
              name="province"
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group col-md-6 mt-3">
            <label htmlFor="category">Category</label>
            <select
              className="form-control"
              name="category"
              onChange={handleChange}
              required
            >
              <option value="" disabled selected>
                -- Select Category --
              </option>
              <option value="Adventure Travel">Adventure Travel</option>
              <option value="Cultural Travel">Cultural Travel</option>
              <option value="Luxury Travel">Luxury Travel</option>
              <option value="Religious Travel">Religious Travel</option>
            </select>
          </div>
        </div>

        <div className="form-group mt-3">
          <label htmlFor="keyHighlights">
            Key Highlights (comma-separated)
          </label>
          <input
            type="text"
            className="form-control"
            name="keyHighlights"
            onChange={handleChange}
            required
          />
        </div>

        <button type="submit" className="btn btn-primary mt-3">
          Submit
        </button>
      </form>
    </div>
  );
};

export default AddDestination;
